import React from 'react';
import VenueCard2 from './VenueCard2';
import './Venue2.css';
import Header from '../Home/partials/Header';
import SearchSection from '../Home/partials/SearchSection';

const venues = [
  {
    name: "Praxis Fitness Hub",
    address: "D.G.S Melkote Park, Nampally",
    image: "Boxcricket.jpeg"
  },
  {
    name: "Dugout Sports Arena",
    address: "4-231/1, Amar Arcade",
    image: "Batminton.jpeg"
  },
  {
    name: "Vishwamanya Badminton",
    address: "Railnilayam Road",
    image: "Cricket.jpg"
  },
  {
    name: "HighBall",
    address: "3-6-363, Street No. 20",
    image: "Football.jpeg"
  },
  {
    name: "Bharathiya Swimming Academy",
    address: "3-6-363, Street No. 20",
    image: "Swimming.jpg"
  },
  {
    name: "Burnley Tennis Club",
    address: "3-6-363, Street No. 20",
    image: "Tennis.jpg"
  }
];

function Venue2() {
  return (
    <div className="venue-section2">
      <Header />
      <SearchSection />
      <div className="venue-section">
      <div className="venue-header2">
        <h2 className="venue-heading2">Book Venues</h2>
      </div>
      <div className="venue-grid2">
        {venues.map((venue, index) => (
          <VenueCard2 key={index} venue={venue} />
        ))}
      </div>
    </div>
    </div>
  );
}

export default Venue2;
